import { useState } from "react"

export const Hamburger = () => {

    let [isActive, setIsActive] = useState(false)

    const clicked = () => {
        setIsActive(!isActive)
    }

    return (
            <button className="hamburger" onClick={clicked}>BUTTON</button>
            
    )
}
